import { Link } from "react-router-dom";

const list = {
  'litanies': 'Ektenie wielkie',
  'antyfonas1': 'Antyfonas I',
  'little-litanies1': 'Ektenie małe I',
  'antyfonas2': 'Antyfonas II',
  'antyfonas3': 'Antyfonas'
}

export const Liturgy = () => {
  return (
    <>
      <ul className="library">
        {Object.keys(list).map(key => (
          <li key={key} className="library__element">
            <Link to={key} className="itemLink">
              {list[key]}
            </Link>
          </li>
        ))}
      </ul>
    </>
  )
}
